import React from "react";
import AutoplaySlider from 'react-awesome-slider';
import AwesomeSliderStyles from 'react-awesome-slider/src/styled/fold-out-animation.scss';

export default function SectionCarousel(){
  return(<AutoplaySlider
    play={true}
    cancelOnInteraction={false}
    interval={5000}
    cssModule={AwesomeSliderStyles}
  >
    <div data-src="assets/img/image/carousel/c1.webp" />
    <div data-src="assets/img/image/carousel/c2.webp" />
    <div data-src="assets/img/image/carousel/c3.webp" />
    <div data-src="assets/img/image/carousel/c4.webp" />
  </AutoplaySlider>
  );
}
